import React, { useState } from 'react';

function ItemCount(props){
    
    const [clicks, setClicks] = useState(1);
    
    
    return(
    <>
        <h3>Item Counter</h3>
        <button onClick={ ()=> setClicks(clicks+1) }>Click me</button>
        <h3>Click: {clicks}</h3>
        <button onClick={ ()=> setClicks(clicks-1) }>Click me</button>
    </>
    )
}


export default ItemCount;
